import React, { Component } from 'react';
import Carts from './Carts';

export class Cart extends Component {
  render() {
    return ( 
      <div className='Carts'>
          <div className='img'></div>
          <div className='name'>{this.props.bland_name}</div>
          <div className='origin'>{this.props.origin}</div>
          <div className='tegs'>{this.props.notes}</div>
      </div>
        
    );
   }
}

export default Cart
